import React from 'react'
import axios from 'axios'
import { useEffect,useState } from 'react'

function App() {

  const [price,setPrice] = useState("")
  const [detail,setDetail]= useState("")
  useEffect(()=>{
    axios.get('https://alpha-vantage.p.rapidapi.com/query').then((res)=>{
      const details = res.data;
      setDetail(details)
    })

  },[])



  return (
    <div>
      <button>update count</button>
      {detail && detail.localeCompare(data =>{
        const {id,datas} = data
        return(
          <div key={id}>
            <h5>{datas}</h5>
          </div>
        )
      })}
    </div>
  )
}

export default App
